import React from "react";
import ReactDOM from "react-dom";

function Joke(prop) {
    return (
        <div className="Joke">
            <h1 className="Question"> <b>Set Up: </b> {prop.question} </h1>
            <h2 className="Answer"> <b> Punchline: </b> {prop.answer} </h2>
        </div>
    )

}

export default Joke;
